import docx
import zipfile
from io import BytesIO
from docx import Document
from docx.shared import Inches
import re

def process_docx_images(input_path: str, width: int = None, height: int = None) -> docx.Document:
    input_zip = zipfile.ZipFile(input_path)
    output_doc = docx.Document()

    for file_name in input_zip.namelist():
        if file_name.startswith('word/media/'):
            image_stream = BytesIO(input_zip.read(file_name))

            if width or height:
                output_doc.add_picture(image_stream, width=width, height=height)
            else:
                output_doc.add_picture(image_stream)

    return output_doc

def format_document(input_path):
    output_doc = process_docx_images(input_path, width=Inches(6), height=Inches(1))

    doc = Document(input_path)

    paragraph_starts = ["Э.", "Тр.", "Р.", "А.", "Н.", "Q2.", "L.", "N.", "F.", "I.", "O.", "Q4.", "C.", "G.", "Q3.", "E.", "B.", "M.", "Q1.", "УП.", "МД.", "УЦ.", "ОР.", "ОН.", "ОК."]

    for para in doc.paragraphs:
        clean_text = re.sub(r'\s+', ' ', para.text).strip()
        words = clean_text.split()

        new_text = ""
        for word in words:
            if any(word.startswith(start) for start in paragraph_starts):
                if new_text:
                    output_doc.add_paragraph(new_text, style='Normal').alignment = 3
                new_text = "\t" + word + " "
            else:
                new_text += word + " "

        if new_text:
            output_doc.add_paragraph(new_text, style='Normal').alignment = 3

    new_file_path = input_path
    output_doc.save(new_file_path)
    return new_file_path

